import React from 'react'
import {getLoginList} from './Nodeservices'
const LoginUserList=()=>{

    const [getList,setList]=React.useState([])
    const fetchData=async()=>{

      var result=await getLoginList('userloginlist')
      setList(result)
      console.log(result)
    }
    React.useEffect(function(){
      fetchData()

    },[])

    console.log(getList)

    return(<>
    <div>
        <center>
            <h1>User Login List</h1>
        </center>
    </div>
    </>)
}

export default LoginUserList
